(62, '', '', '', '', 'The SETI instrument (SERENDIP IV) works in parallel with the 32 m antenna and automatically analyses detected signals, 24 hours a day. In this manner, the SETI project can be conducted without requiring active observation time or dedicated personnel.', '', 'The Radioastronomy Institute (IRA), also, operates another 32 m antenna located in Noto (Sicily), and a third (64 m parabolic) antenna is now under construction near Cagliari (Sardinia).', ''),
