(73, 'Scott Dahm - sdahm@keck.hawaii.edu - HIRES (primary)\r\n Hien Tran - htran@keck.hawaii.edu - HIRES (secondary)', 'For a current list of instruments that can be used with Keck I and Keck II, as well as a list of visiting, future and past instruments, please see:\r\nhttp://www2.keck.hawaii.edu/inst/index.php\r\n\r\n', '', 'ADC - The Cassegrain Atmospheric Dispersion Compensator module for the Keck I telescope allows LRIS to operate with reduced differential refraction from zenith to an airmass of 2.', '', '', '', ''),
