(75, '', '', '4 Auxillary Telescopes complement the 4 large optical telescopes to create an optical interferometer', 'Optical, Infrared Cameras and Spectrographs. http://www.eso.org/sci/facilities/paranal/instruments/overview.html', '', '', 'Three operation modes:\r\n* as a set of four independent telescopes\r\n* as a single large coherent interferometric instrument, for extra resolution\r\n* as a single large incoherent instrument, for extra light-gathering capacity\r\n\r\nProposals: http://www.eso.org/sci/observing/proposals/index.html March and September deadlines', ''),
