(80, 'http://www.eso.org/sci/facilities/lpo/contact.html', '', '66 High precision antennas operationg at 0.3 to 9.6 mm. Fifty 12-meters diameter antennas will be used for interferometry, four 12-meters diameter antennas for total power and twelve 7-meters diameter antennas for short spacings interferometry. All the ALMA antennas will be equipped with ten frequency bands covering all atmospheric windows open from the Chajnantor site between 30GHz and 1THz', '', '', '', 'ALMA will begin scientific observations in the second half of 2011 and is scheduled to be fully operational by the end of 2012.', ''),
