(112, '', '', '', '', '', 'NEOs (Near-Earth Objects)', 'Become a supporter of Boyden, by joining the Friends of Boyden, a public interest group which fosters a wider appreciation of the astronomical activities of the Observatory and who promote public interest in its affairs. The Friends contributed efforts to ensure that the Observatory survived some turbulent years. Boyden is now a prime astronomical research and public educational centre in Southern Africa: http://www.assabfn.co.za/friendsofboyden/index.htm', ''),
