(133, '', '', '', 'Occultation camera: Watec 902 H2 Ultimate   Minimal flux: 0.0001 lux   Maximum Frame per Second: 50 fps (odd/even)   1/2inch chip, 752x582 pixels', 'In 2007 we contributed with an  observation of a mutual event between the Uranian satellites Umbriel and Oberon. Paper published in A&amp;A: http://www.aanda.org/index.php?option=article&amp;access=doi&amp;doi=10.1051/0004-6361/200811523    b. In 2009 and 2010 we made many successfull observations of Saturnian and Jovian mutual events for PHEMU09 and PHESAT-09, which we have submitted to IMCCE (FR).    3. In August 3rd 2009 we have made a successfull observation of the occultation of 45-Capricorni by Jupiter see: http://www.iota-es.de/jupiter2009/occultation_results01.html  Our preliminary light curves: http://www.spartastronomy.gr/arthra/jupiter_45_cap/light-curves     4. Asteroid astrometry and asteroidal occultaions are other areas of interest for Ellinogermaniki Agogi Observatory.  \r\na. In 2007 we contributed with an  observation of a mutual event between the Uranian satellites Umbriel and Oberon. Paper published in A&amp;A: http://www.aanda.org/index.php?option=article&amp;access=doi&amp;doi=10.1051/0004-6361/200811523    b. In 2009 and 2010 we made many successfull observations of Saturnian and Jovian mutual events for PHEMU09 and PHESAT-09, which we have submitted to IMCCE (FR).    3. In August 3rd 2009 we have made a successfull observation of the occultation of 45-Capricorni by Jupiter see: http://www.iota-es.de/jupiter2009/occultation_results01.html  Our preliminary light curves: http://www.spartastronomy.gr/arthra/jupiter_45_cap/light-curves     4. Asteroid astrometry and asteroidal occultaions are other areas of interest for Ellinogermaniki Agogi Observatory.  ', '', 'Mr Vagelis Tsamis is a member of IOTA (www.iota-es.de) and is the operator of the 0.4 m telescope.    Dr Sofoklis Sotiriou is the administrator and director of the EA Observatory.    Dr Apostolos Christou is a scientific advisor of EA Obs, and an astronomer working in Armagh Observatory (UK). ', ''),
(134, '', '', '', '', 'Research SN, Astéroides, Asteroids and comets rotation curves,  Regular variable stars light curves, Exoplanets\r\n', '', '', ''),
(135, '', '', 'It has a range of 5-300 GHz. It works alongside two other radio observatories, Galenki RT-70 radio telescope and Suffa RT-70 radio telescope.', '', '', '', 'Is able to transmit messages to extraterrestrial civilizations.', ''),
(136, '', '', '', '', '', '', 'Proposal submission online via poopsie http://cadc.hia.nrc.gc.ca/poopsy/obsprop.html', ''),
(137, '', '', '', '', 'Main fields of work: Planetary imaging, variable star photometry, supernova search, asteroid occultations', '', 'My background is Assoc. Prof at Uppsala Univ., Dept. of Physics and Astronomy', ''),
(139, '', '', '', '- Starlight Xpress USB Filterwheel:  SXUFW-2T USB Filter Wheel with internal 5 position\r\n- Seletek focuser with Schmidt-Cassegrain SSCT-30B  Crayford focuser  \r\n- Qcam5 guide/planetcamera  ', 'I`m an Amateur Astronomer, so I dont think we can call it research, but I do try to take nice pictures of Galaxys, Nebulas, Planets, Comets etc.\r\n', '', '', ''),
(140, '', '', '', '', '', '', '', ''),
(141, '', '', '', 'Redshift Search Receiver 74-110.5 GHz SEQUOIA Receiver 85-115.6 GHz', '', '', 'Proposal sheet: http://www.astro.umass.edu/~fcrao/observer/proposal/fcrao-prop.tex Deadlines usually around 15 Sept, 15 January', ''),
(142, '', '', '', '', '', '', '', ''),
(143, '', 'Additional instruments:\r\n\r\n- H-alpha Personal Solar Telescope - Coronado PST (http://www.dangl.at/ausruest/ausrst09.htm)\r\n- Fujinon 16 x 70 FMT-SX (http://www.dangl.at/ausruest/ausrst03.htm)\r\n- Newton Optus 3''''\r\n(http://www.dangl.at/ausruest/ausrst02.htm)', '', '- BW Video camera  WAT-120N (with integrating feature)  \r\n- BW Video camera  WAT-902H2 Ultimate\r\n- KIWI-OSD GPS Video time inserter\r\n- BW digital Video camera DMK21AU04AS\r\n- BW cooled CCD camera Atik314L+  \r\n- Collection of filters \r\n- EL Flat field foil A3  ', '', '', 'The observatory in reality is a mobile amateur station mainly used at the coordinates given.  ', ''),
