(176, 'http://park22.wakwak.com/~nict-kasse2/input_e.html', '\r\n- Further antennas available at KSTC:\r\n* 13m antenna for Broadcasting Sattelite experiments\r\n* 13m antenna for Communications Sattelite experiments\r\n* Rotary-Baseline Interferometer\r\n* 34m antenna for Radio Astronomy and VLBI\r\n* 11m antenna for Very Long Baseline Interferometry (Key Stone Project)\r\n\r\n- Others:\r\n* 75cm optical telescope for Satellite Laser Ranging (Key Stone Project)\r\n* Optical Monitoring and Tracking(cluster 35cm telescopes)\r\n* Sundials\r\n* Radio Anechoic Chamber\r\n* Chemical Etching Room', '', '', '', '', '', ''),
