(183, 'Phone: \r\nUrl: http://www.ctio.noao.edu/\r\n - \r\nLatitude: ? - Longitude: ?', 'Other smaller Telescopes are available', '', '4k x 4k CCD Camera ; Various Spectrograph and Imagers are also available at different wavelength ranges.', '', '', 'http://www.noao.edu/gateway/propinfo.html', ''),
