(770, 'Direct Camera / Camera with Spectrometer', 5, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '4000x4000', 60, 12000, 0, '', 'Filters: UG1 2mm; GG385 2mm; GG495 2mm; RG610 3mm'),
(772, 'Princeton Instruments VersArray 2048B', 5, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '7.92x7.92 arcmin', 0, '2048x2048', 0, 0, 0, '', ''),
(773, 'Bolocam large-format bolometric camera', 5, '', '1.1-2.1 mm', 0.000000, 1, 0.000000, 1, '38 arcsec per pixel', '', '', '8 arcmin (circular)', 0, '115 pixels hexagonal', 0, 0, 0, '', 'http://www.cso.caltech.edu/bolocam/'),
(774, 'SHARCII Submillimeter High Angular Resolution Camera', 5, '', '350/450/850 um', 0.000000, 1, 0.000000, 1, '4.85 arcsec per pixel', '', '', '2.59x0.97 arcminute', 0, '12x32 pixel bolometer array', 0, 0, 0, '', 'http://www.submm.caltech.edu/%7Esharc/'),
(782, 'BFOSC - Bologna Faint Object Spectrograph & Camera', 8, '', 'optical, ', 330.000000, 8, 1100.000000, 8, '0.58 arsec/pixel', '4200 (max.)', '', '13 x 12.6 arcmin', 0, '1300 x 1340', 0, 0, 0, 'EEV LN/1300-EB/1', 'The slit wheel, mounted on the telescope focal plane, can hold 7 different slits, with one of the apertures intentionally left empty to allow direct image acquisition. At present four different slits are available: 1.5", 2", 2.5" and 5", a special 2" slit for echelle spectra and a mask to be used for polarimetry.\r\nThe slit length is as large as the usable field while the echelle slit is 9" long. \r\nThe filter wheel also has seven available positions. At present, the following filters can be mounted:\r\nU, B, V, R, I - Johnson-Kron-Cousin filters\r\nG, R, Z, I - Thuan-Gunn filters.\r\n\r\nA cross-disperser (#10, #11, #12) can also be mounted on the filter wheel and used with the echelle grism #9 to allow medium dispersion spectroscopy. A differential filter, used as an order separator, is mounted on the filter wheel in conjuction with grism #13. Two Hartmann masks can also be mounted to control the camera focusing. A table of available grisms can be found in the user manual: http://www.bo.astro.it/~loiano/TechPage/bfosceng/BFOSC.html'),
(784, 'WFCAM Wide Field Infrared Camera', 5, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '', 0, 0, 0, '', 'http://www.jach.hawaii.edu/UKIRT/instruments/wfcam'),
(785, 'IRPOL Infra-Red Polarimetry facility', 3, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '', 0, 0, 0, '', 'http://www.jach.hawaii.edu/UKIRT/instruments/irpol/irpol.html'),
(786, 'CGS4', 1, '', '1-5um', 0.000000, 1, 0.000000, 1, '0.41x0.90 arcsec per pixel', '', '', '', 0, '256x256 InSb array', 0, 0, 0, '', 'http://www.jach.hawaii.edu/UKIRT/instruments/cgs4/cgs4.html'),
(787, 'UFTI UKIRT Fast-Track Imager', 5, '', '', 0.000000, 1, 0.000000, 1, '0.091 arcsec per pixel', '', '', '92 arcsec', 0, '1024x1024 HgCdTe array', 0, 0, 0, '', 'http://www.jach.hawaii.edu/UKIRT/instruments/ufti/ufti.html'),
(788, 'UIST UKIRT 1-5 micron Imager Spectrometer', 1, '', '1-5 um', 0.000000, 1, 0.000000, 1, '0.12 or 0.06 arcsec per pixel', '', '', '2x2 or 1x1 arcminute', 0, '1024x1024 InSb array', 0, 0, 0, '', 'http://www.jach.hawaii.edu/UKIRT/instruments/uist/uist.html\r\nhttp://docs.jach.hawaii.edu/UKIRT/SPIE/5492/1160/Howatt_UIST_2004.pdf'),
