(795, 'ULBCAM infrared camera', 5, '', 'infrared, ', 0.000000, 1, 0.000000, 1, '', '', '', '17x17 arcmin', 0, '', 0, 0, 0, '', 'Mosaic infrared camera with four close-packed 2048x2048 arrays\r\nJ and H filters only\r\nThermal IR imaging is not possible with this camera'),
