(844, 'SBIG STL-11000M-C2', 5, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '4008 x 2672', 0.001, 3600, 1, 'Kodak KAI-11000M, Class 2', 'Built-in 5-position, 50-mm filter wheel which has been fitted with the following 2-inch filters:\r\n1. Hutech IDAS Light pollution suppression (LPS) filter with IGAD Coating\r\n2. Baader L filter\r\n3. Baader R filter\r\n4. Baader G filter\r\n5. Baader B filter\r\n\r\nExtra available 2-inch filters for the "Hubble pallet":\r\n-Astrodon Narrowband H-alpha 3-nm filter 50 mm\r\n-Astrodon Narrowband OIII 3-nm filter 50 mm\r\n-Astrodon Narrowband fSII 3-nm filter 50 mm \r\n\r\nThe SBIG camera has the Astrodon-MOAG-A and the SBIG AOL/STL installed, providing ADAPTIVE OPTICS WITH OFF-AXIS GUIDING.\r\nGuiding camera: Lodestar Autoguider or internal autoguider chip.'),
(848, 'Galway Ultra Fast Imager (GUFI)', 5, '', 'optical, ', 0.000000, 1, 0.000000, 1, '', '', '', '13 arcmin', 0, '', 0, 0, 0, 'L3CCD system, based on an Andor iXon back-illuminated CCD camera', 'The L3CCD system gives a readout time of only 2 ms, extremely high time resolutions of up to 400 images a second (subframed), and very low light level sensitivity.\r\n\r\nOn loan from NUI Galway, currently until June 2011.'),
(849, 'VATT CCD Spectrograph (VATTSpec)', 1, '', 'optical, ', 360.000000, 8, 950.000000, 8, '', '', '', '', 0, '2688 x 512', 0, 0, 0, 'back illuminated, low noise CCD STA0520A CCD', 'This optical region spectrograph has AR coated refractive optics, with beam size at its camera of 125 mm, giving:\r\n-Slit length: 30 arcsec\r\n-Spectral coverage: 100 nm at 0.1 nm resolution. \r\n-Spectral resolutions: 0.1, 0.2, and 0.4 nm with 1 arcsec wide slit.'),
