(859, 'Starlight Xpress SXVR-H36', 5, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '4904x3280', 0, 0, 0, 'Kodak KAI16000M', 'Filters: Starlight Xpress + Astronomik LRGB 50mm'),
(868, 'Meade ', 5, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 100, '1360x1024', 0.0001, 3600, 1, 'SONY Ex View HAD ICX285AL', ''),
(869, 'SBIG ST6', 5, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '375x242', 0.01, 3600, 1, 'TI TC-241', ''),
(870, 'GMOS - Gemini Multi-Object Spectrograph', 8, '', 'optical, ', 360.000000, 8, 940.000000, 8, '0.073 arcsec per pixel', '', '', '330 arcsec x 330 arcsec', 0, '', 0, 0, 0, '', 'GMOS is a multi-object, long-slit and IFU spectrograph and imager. \r\n\r\nThree types of spectroscopy are possible with its selection of gratings:\r\n-Long-slit spectroscopy, which covers the full extent of the CCD package (3 x 2048 pixels) with two small gaps.\r\n-Multi-object spectroscopy, which uses custom-designed, laser-milled masks.\r\n-Integral field spectroscopy, which uses 0.2 arcsec fibers covering a 35 square arcsec field of view.\r\n\r\nGMOS can perform broad band imaging (using the SDSS filter system) or narrow-band imaging using select filters. For imaging, the field of view is 5.5 arcmin x 5.5 arcmin. \r\n\r\nFor further details about this instrument see: http://www.gemini.edu/node/10625'),
(871, 'T-ReCS - Thermal-Region Camera Spectrograph', 8, '', 'Mid-infrared (MIR)', 8.000000, 9, 26.000000, 9, '0.09 arcsec per pixel', 'R~100-1000', '', '', 0, '', 0, 0, 0, '', 'T-ReCS is a mid-infrared imager and long-slit spectrograph. When combined with Gemini''s fast tip/tilt compensating secondary mirror, T-ReCS will yield nearly diffraction-limited 10-µm images under most natural seeing conditions. \r\n\r\nT-ReCS is capable of imaging in the 8–26 µm range as follows:\r\n-Broad-band (N, Q) and Narrow-band Filter Imaging\r\n-Pixel size = 0.09" (fixed)\r\n-Field of view = 28.8"×21.6"\r\n-Number of filters: currently 20, capacity for 24\r\n-Occulting bar available for imaging (2" wide)\r\n\r\nT-ReCS is capable of spectroscopy with R~100 - 1000 in the 8–26 µm range as follows:\r\n-Low resolution long-slit spectroscopy: R ~ 100 near 10 µm, R ~ 80 near 20 µm\r\n-Medium long-slit spectroscopy: R ~ 1000 near 10 µm\r\n-Pixel size in spatial direction = 0.09" (fixed)\r\n-Slit length = 21.6"\r\n-Slit widths = 0.21" to 1.32"\r\n-Low-Res Dispersion at 10 µm = 0.02213 µm/pix, delta lambda = 7.1 µm (entire N band) across detector\r\n-Low-Res Dispersion at 20 µm = 0.033 µm/pix, delta lambda = 10.6 µm (entire Q band)\r\n-Hi-Res Dispersion at 10 µm = 0.0019 µm/pix, delta lambda = 0.6 µm\r\n\r\nFor further details about this instrument see:\r\nhttp://www.gemini.edu/sciops/instruments/trecs'),
(872, 'NICI - Near-Infrared Coronagraphic Imager', 6, '', 'Near-infrared (NIR)', 1.000000, 9, 5.000000, 9, '18 mas per pixel', '', '', '18 arcsec x 18 arcsec', 0, '1024 x 1024', 0, 0, 0, '1024x1024 ALADDIN InSb array', 'NICI combines an 85-element curvature adaptive optics system, a dedicated Lyot coronagraph, and a specialized dual-channel camera into a single instrument optimized to detect large Jovian-type planets around nearby stars.\r\n\r\nFor further details about this instrument, see:\r\nhttp://www.gemini.edu/sciops/instruments/nici/?q=sciops/instruments/nici'),
(873, 'GMOS - Gemini Multi-Object Spectrograph', 8, '', 'optical, ', 0.360000, 9, 1.030000, 9, '0.089 arcsec per pixel', '', '', '', 0, '~ 6144x4176 pixels', 0, 0, 0, 'GMOS-N Array (Hamamatsu), Three ~ 2048x4176 chips in a row with ~ 1mm gaps', 'GMOS is a multi-object, long-slit and IFU spectrograph and imager.\r\n\r\nThree types of spectroscopy are possible with its selection of gratings:\r\n-Long-slit spectroscopy, which covers the full extent of the CCD package (3 x 2048 pixels) with two small gaps.\r\n-Multi-object spectroscopy, which uses custom-designed, laser-milled masks.\r\n-Integral field spectroscopy, which uses 0.2 arcsec fibers covering a 35 square arcsec field of view.\r\n\r\nGMOS can perform broad band imaging (using the SDSS filter system) or narrow-band imaging using select filters. For imaging, the field of view is 5.5 arcmin x 5.5 arcmin.\r\n\r\nFor further details about this instrument see: http://www.gemini.edu/node/10625'),
(874, 'Michelle', 8, '', 'Mid-infrared (MIR)', 7.000000, 9, 26.000000, 9, '0.1005, 0.183 arcsec per pixel', '', '', '', 0, '320x240', 0, 0, 0, 'Si:As IBC array', 'Michelle is a mid-infrared (7-26 micron) imager and spectrometer, with gratings and echelle capability. Imaging polarimetry is now also supported. \r\n\r\nFor further details about this instrument see:\r\nhttp://www.gemini.edu/sciops/instruments/michelle/?q=sciops/instruments/michelle'),
(875, 'GNIRS', 1, '', 'Near-infrared (NIR)', 1.000000, 9, 5.500000, 9, '0.15, 0.05 arcsec per pix', 'R~1700, 5000, 18000', '', '', 0, '', 0, 0, 0, '', 'GNIRS offers a wide variety of spectroscopic capabilities including long-slit (single order) spectroscopy within the 1.0-5.4 µm range at 2-pixel spectral resolving powers, R, of approximately 1700, 5000 and 18000 with a choice of two pixel scales (0.15"/pix and 0.05"/pix), and cross-dispersed spectroscopy giving complete 0.9-2.5 µm coverage at R~1700 and partial coverage at R~5000. A variety of slit widths from 0.10 to 1.0 arcsec are available.  \r\n\r\nGNIRS also has limited imaging capabilities. The instrument can be used with adaptive optics over most of its wavelength range. \r\n\r\nFor further details about this instrument see:\r\nhttp://www.gemini.edu/sciops/instruments/gnirs\r\n\r\n*check the status of this instrument from the link above - should be unavailable for 2 weeks from 13 Feb 2012'),
(876, 'NIFS - Near-infrared Integral Field Spectrometer', 1, '', 'Near-infrared (NIR)', 1.000000, 9, 2.500000, 9, '', 'R=5000', '', '3x3 arcsec', 0, '', 0, 0, 0, '', 'NIFS provides 3D imaging spectroscopy with spectral resolving power of R~5000 over a 3.0" x 3.0" image field in the Z through K-band spectral regions (0.95 to 2.40 μm). \r\n\r\nNIFS is designed to be fed by the Gemini North Adaptive Optics system, ALTAIR, hence it is possible to achieve spatially resolved spectroscopy on scales as small as 0.1" using Natural or Laser guide stars. \r\n\r\nCoronographic spectroscopy can also be performed through use of an occulting mask. \r\n\r\nFor further details about this instrument see:\r\nhttp://www.gemini.edu/sciops/instruments/nifs/?q=sciops/instruments/nifs'),
(877, 'NIRI - Near InfraRed Imager and Spectrometer', 8, '', 'Near-infrared (NIR)', 1.000000, 9, 5.500000, 9, '', '', '', '', 0, '', 0, 0, 0, '1024x1024 ALADDIN InSb array', 'The instrument has three cameras: f/32, f/14, and f/6. In imaging mode they provide plate scales of 0.022, 0.050, and 0.117 arcsec pixels, respectively and fields of view of 22x22, 51x51, and 120x120 arcsec squared, respectively. \r\n\r\nA large number of broad- and narrow band filters are available.\r\n\r\nThe Gemini facility adaptive optics (AO) system, ALTAIR, is available for use with NIRI at f/14 or f/32, either with a natural guide star or the laser guide star, for all imaging except in the M band. \r\n\r\nAt f/6 a set of KRS5 grisms, slits of varying width, and blocking filters are available to provide low-moderate-resolution spectroscopic coverage over almost the entire 1.0-5.5 μm region. \r\n\r\nFor further details about this instrument see:\r\nhttp://www.gemini.edu/sciops/instruments/niri/?q=sciops/instruments/niri'),
