(948, 'AIMPOL (ARIES Imaging Polarimeter)', 3, '', 'optical, ', 445.000000, 8, 658.000000, 8, '', '', 'linear polarisation in BVR bands', '2 arcmin', 0, '1024 x 1024', 0, 0, 1, 'Tektronics 1k CCD with 24 micron pixel size', 'Using the 104-cm telescope, AIMPOL can measure polarisation of a 13 magnitude star in a 2 minute exposure time with 0.18 percent accuracy. \r\nPerformance of this instrument is described by Rautela et al. (2002).'),
