(951, 'ACS (ARIES CCD spectrograph)', 1, '', 'optical, ', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '1024 x 1024', 0, 0, 0, 'Tektronics 1k CCD with 24 micron pixel size', 'This HR-320 spectrograph is used with the Tek 1k CCD detector to take low resolution spectra of bright stars up to 12 mag. It uses circular aperture and is best suited for estimating continuum and broad (EW 10 angstrom or higher) emission features in stars or astronomical objects.'),
(952, 'ARCES - ARC Echelle Spectrometer', 1, 'Nasmyth Port (NA1)', 'optical, infrared (IR), ', 320.000000, 8, 1000.000000, 8, '', '31.5', '', '1.6x3.2; 1.6x4.7; 1.6x1.6; 0.9x0.9', 0, '2048x2048', 0, 0, 0, '', '- CCD camera e2v (Marconi) CCD77-00 attached to this instrument (see http://www.apo.nmsu.edu/arc35m/Instruments/ARCES/ccd_77.pdf for further information)\r\n\r\n- Further information on the whole instrument can be found under: http://www.apo.nmsu.edu/arc35m/Instruments/ARCES/\r\n'),
(953, 'DIS - Dual Imaging spectrograph', 1, 'Nasmyth port (NA2)', 'around 5350 Angstrom', 0.000000, 1, 0.000000, 1, '0.40 (blue channel); 0.42 (red channel)', '', '', '261.6 (broadband); 240 (narrowband)', 0, '', 0, 0, 0, '', '- The instrument currently uses two E2V 2048x1024 CCDs. \r\n\r\n- Further information on the whole instrument can be found under: http://www.apo.nmsu.edu/arc35m/Instruments/DIS/'),
(954, 'SPIcam - Seaver Prototype Imaging camera', 5, '', 'optical, ', 400.000000, 8, 900.000000, 8, '0.14 or 0.28', '', '', '286.8', 0, '', 0, 0, 0, 'backside-illuminated SITe TK2048E 2048x2048 pixel CCD with 24 micron pixels', '- Several filter wheels available; the most common filters used are either the SDSS u''g''r''i''z'' filters or the MSSSO UBVRI filter set. Other filters are available. The full set of filters available at APO can be found under: http://filters.apo.nmsu.edu/\r\n\r\n- Further information on the whole instrument can be found under: http://www.apo.nmsu.edu/arc35m/Instruments/SPICAM/'),
(955, 'NIC-FPS - Near-Infrared Camera & Fabry-Perot Spectrometer', 1, 'Nasmyth port (NA2)', 'infrared (IR), ', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '', 0, 0, 0, '', '- NICFPS reimages the telescope focal plane using cryongenic optics; it has three filter wheels hosting a set of 4 broadband and 12 narrow-band filters, plus a filter mask for dark frames. A Lyot stop is positioned in the telescope pupil plane. The cryongenic etalon can be positioned into the optical path for the Fabry-Perot mode (but has not yet become fully operational). The detector is a Rockwell Hawaii 1-RG 1024x1024 HgCdTe device with a 0.273 arsec/pixel scale and 4.58 arcmin sqaure, unvignetted field, and sensitivity from 0.85 to 2.4 microns. The instrument is designed for high throughput and 2 pixel (at 2 microns) sampling under good seeing conditions (~0.5 arcsec) at Apache Point.\r\n\r\n- NICFPS has two warm coronagraphic masks available for use\r\n\r\n- Further information on the whole instrument can be found under: http://www.apo.nmsu.edu/arc35m/Instruments/NICFPS/'),
