(1191, 'Bench Spectrograph', 1, '', 'optical, ', 350.000000, 8, 950.000000, 8, '', '', '', '', 0, '', 0, 0, 0, '', 'http://www.wiyn.org/Instruments/wiyninstrument_current.html#bench\r\n\r\nRecent upgrades to the instrument and further specifications can be found in Bershady et. al, "WIYN bench upgrade: a revitalized spectrograph" (http://www.wiyn.org/Instruments/bershady_bench_spie08.pdf)'),
(1192, 'Hydra Spectrograph', 1, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '', 0, 0, 0, '', 'http://www.wiyn.org/Instruments/wiyninstrument_current.html#hydra\r\n\r\nHydra is a multi-object spectrometer that utilizes fiber optics placed in the focal plane to simultaneously transmit the light from numerous objects to a bench-mounted spectrograph that records the spectrum of each object onto a CCD detector. '),
(1193, 'MiniMo', 5, '', 'optical, ', 3000.000000, 7, 8400.000000, 7, '', '', '', '', 0, '', 0, 0, 0, 'Two SITe 4096x2048 chips', 'http://www.wiyn.org/Instruments/wiyninstrument_current.html#mimo\r\n\r\nThe WIYN Mini-Mosaic Imager consists of two SITe 4096x2048 chips separated by a tiny gap mounted in a dewar. \r\n\r\nThe CCDs have excellent cosmetics, high quantum efficiency, and allow good sampling (0.14"/pixel) and a large field of view (9.6x9.6 arcmin). Each of the two CCDs is read out through 2 amplifiers.'),
(1194, 'SparsePak', 6, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 0, '', 0, 0, 0, '', 'http://www.wiyn.org/Instruments/wiyninstrument_current.html#spsk\r\n\r\nSparsePak is a sparsely packed fiber optics bundle with nearly-integral core that has a special fiber geometry designed to optimize performance for the specific scientific goal of studying the spatial distribution of the internal motions of gas and stars in nearby galaxies, but is also useful in general for the study of galactic and extra- galactic nebulae. SparsePak mounts into WIFOE.'),
(1195, 'WHIRC (+ WTTM)', 5, '', 'Near infrared', 1.000000, 9, 2.500000, 9, '', '', '', '', 0, '', 0, 0, 0, '', 'http://www.wiyn.org/Instruments/wiyninstrument_current.html#whirc\r\n\r\nThe WIYN High Resolution Infrared Camera (WHIRC) is a joint project between the WIYN partners, and STScI. WHIRC is a 2K x 2K near-infrared imager that can be used with the WIYN Tip-Tilt Module (WTTM). WHIRC + WTTM provides a powerful combination of high spatial resolution, high sensitivity, and a moderately wide FOV (3.3''x3.4''). \r\n\r\nIn good conditions WTTM can be expected to improve image quality, reducing the FWHM of point sources by ~0.1" or more.\r\n\r\nIt is a general purpose instrument for a wide range of science, offering the standard broadband filters (JHK), as well as a number of narrowband filters.'),
(1196, 'Atik 314L+', 5, '', '', 0.000000, 1, 0.000000, 1, '', '', '', '', 1, '1391 x 1039', 0.001, 10000, 1, 'Sony ICX285AL', ''),
(1209, 'ALFOSC - Andalucia Faint Object Spectrograph and Camera', 8, '', 'UV-optical', 280.000000, 8, 2250.000000, 8, '0.19', '', 'linear and/or circular modes available', '6''.4 x 6''.4', 0, '2048 x 2048(+4)', 0, 0, 0, 'E2V 2kx2k CCD42-40 nimo back illuminated', 'http://www.not.iac.es/instruments/alfosc/\r\nALFOSC can be used for UV-optical imaging, polarimetry and low-resolution spectroscopy.\r\n\r\nALFOSC spectroscopy 	from 3200-11000Å, with dispersion (Å/pixel) of 0.26-13.7 for long slit (5''), and 0.4 in echelle mode (slit length 8"). Spectropolarimetry and Multi Object (MOS) mode also available.\r\n\r\nFor polarimetry:\r\nALFOSC FAPOL+ calcite: Various optical filters, FoV 140" diameter, modes: linear and/or circular (also for spectropolarimetry)\r\nALFOSC polaroid: Various optical filters, FoV 6''.4 x 6''.4, mode: linear, for extended targets.\r\nALFOSC +WeDoWo: Various optical filters, mode: linear 	'),
(1210, 'NOTCam - Nordic Optical Telescope near-infrared Camera and spectrograph', 8, '', 'infrared, ', 0.800000, 9, 2.500000, 9, '', '', '', '', 0, '1024 x 1024', 0, 0, 0, 'HgCdTe', 'http://www.not.iac.es/instruments/notcam/\r\nNOTCam - NIR imaging and low-resolution spectroscopy \r\n\r\nNOTCam is capable of:\r\nWide field imaging (4''×4'' @ 0.234"/pixel)\r\nHigh resolution imaging (80"×80" @ 0.078"/pixel)\r\nLow-resolution (R = 2500) WF-cam spectroscopy (Y,J,H,K) \r\nMedium-resolution (R = 5500) HR-cam spectroscopy (J,H,K)\r\n\r\nIn the future, expected to upgrade NOTCam with Wollaston prisms for imaging polarimetry and spectro-polarimetry. '),
(1211, 'FIES - FIbre-fed Echelle Spectrograph ', 1, '', 'optical', 370.000000, 8, 730.000000, 8, '', '', '', '', 0, '', 0, 0, 0, '', 'http://www.not.iac.es/instruments/fies/\r\nFIES - High-resolution, high-stability optical spectroscopy\r\n\r\nThe currently installed fiber bundle contains a high-res 1.3 arcsec fibre offering a spectral resolution of R=67000. This bundle also provides two 1.3 arcsec fibres giving R=46000 (med-res), and a fibre with a larger entrance aperture of 2.5 arcsec but a lower spectral resolution (R=25000, low-res). '),
(1212, 'MOSCA - MOSaic CAmera ', 5, '', 'UV-optical', 0.000000, 1, 0.000000, 1, '0.217"/pixel on sky (2x2 binning)', '', '', '7''.7 x 7''.7', 0, '', 0.5, 0, 0, '4 2048x2048 Loral-Lesser thinned CCDs (CCD7/10/11/12)', 'http://www.not.iac.es/instruments/mosaic/\r\n\r\nMOSCA - High-resolution, high-efficiency UV-optical imaging\r\n\r\nFilters: Full field of view with 100 mm filter, 60mm round filter FOV about 5''25" (diameter) Available filters: (100 mm) Bessell UBVRI, SDSS u''g''r''i''z'';(90mm) Strömgren uvby, H-beta wide, narrow (see filters at NOT).'),
(1213, 'StanCam - Standby CCD Camera', 5, '', '', 0.000000, 1, 0.000000, 1, '0.176', '', '', '3'' x 3''', 0, '1024 x 1024', 0, 0, 0, 'TEK 1024x1024 back-side illuminated thinned CCD', 'http://www.not.iac.es/instruments/stancam/\r\n\r\nStanCam is mounted in a folded Cassegrain focus and kept cool using CryoTiger. It is used as an optical imaging instrument when ALFOSC or MOSCA is not mounted and also as a FIES fiber viewer.'),
