(1655, '104-cm Sampurnanand Telescope (SNT)', 5, 0, 1, 1.040000, 'f/13', 1, 'ultraviolet, optical, infrared, ', 300.000000, 8, 1000.000000, 8, 'Focal plane instruments:\r\n- Cassegrain plate holder,\r\n- Meinel camera,\r\n- photoelectric photometer,\r\n- near-infrared photometer, \r\n- laboratory spectrum scanner, \r\n- CCD chips of sizes 384x576, 1024x1024 and 2048x2048 pixels. For spectrophotometric observtions, an optical multi-channel analyzer with 1024 pixel Reticon array as detector is also available.\r\n\r\nThe filter set available at ARIES is Johnsons UBV and Cousins RI.'),
(1656, '130-cm Devasthal Fast Optical Telescope (DFOT)', 5, 0, 1, 1.300000, 'f/4', 1, 'infrared, optical, ultraviolet, ', 300.000000, 8, 1000.000000, 8, 'Note: DFOT is located at Devasthal, altitude 2450 m AMSL, Lat. 29.38°, Long. 79.68°\r\n\r\nThree CCD cameras are currently available with the telescope for obtaining images of the celestial sky. The cameras are:\r\n(1) 2048x2048 pixels, 13.5 micron pixel size conventional back-illuminated, deep thermoelectrically cooled (-800 C) CCD,\r\n(2) 512x512 pixels, 16 micron pixel size electron multiplying frame transfer back-illuminated, deep thermoelectrically cooled (-900 C) CCD,\r\n(3) 3326x2504 pixels, 5.4 micron, front illuminated, thermoelectrically cooled (-300 C) conventional CCD. The first two cameras use high quantum efficiency E2V chip, assembled by ANDOR with low read noise electronics. The third camera is from SBIG using Kodak chip.'),
(1657, 'ARC Astrophysical Research Consortium Telescope', 5, 0, 0, 3.500000, '', 1, 'optical, infrared, ', 0.000000, 1, 0.000000, 1, '- Alt-azimuth mount with instruments attached at several focal points\r\n\r\n- Used by the Apache Point Observatory Lunar Laser-ranging Operation (APOLLO) lunar-ranging project\r\n\r\n- Observations using the 3.5 m telescope can be carried out remotely by observers using TUI, the Telescope User Interface, via the internet: http://www.apo.nmsu.edu/35m_operations/TUI/\r\n\r\n- A list of all instruments available for this telescope can be found under (the permanent mounted instruments are listed below): http://www.apo.nmsu.edu/arc35m/Instruments/index.html'),
(1658, 'Sloan Digital Sky Survey', 5, 0, 0, 2.500000, '', 1, 'optical, infrared (IR), ', 0.000000, 1, 0.000000, 1, '- Further instrument (despite those below): SEGUE-2 Spectrograph (http://www.sdss3.org/instruments/segue2_spectrograph.php)\r\n\r\n- Mostly used for sky survey\r\n\r\n- Further information on the SDSS available under: http://www.sdss3.org/index.php'),
